import Togglable from './Togglable'

const Blog = ({ blog, toggleDetails }) => {
  const blogStyle = {
    paddingTop: 10, 
    paddingLeft: 2, 
    border: 'solid', 
    borderWidth: 1, 
    marginBotton: 5
  }

  return (
    <li className='blog'>
      {blog.title} by {blog.author} 
      <Togglable buttonLabel="view">
        <div>{blog.url}</div>
        <div>likes {blog.likes}</div>
        <div>{blog.user.name}</div>
      </Togglable>  
    </li>  
  )
}

export default Blog
